webpackJsonp([0xc865ef30d9d8],{534:function(A,I){A.exports={data:{pages:{internal:{content:'{"id":10,"title":"Building Block A: Analysis","slug":"building-blocks/analysis","template":"buildingBlock.jsx","category":"building_block"}'},childPagesContent:{internal:{content:'{"0":{"type":"section","content":{"0":{"text":"Background","type":"header"},"1":{"text":"<p>Understanding the context, including HHs, communities and markets, is a first key step in improving PA outcomes for children. This includes understanding essential issues, such as:&nbsp;</p>\\n<ul>\\n<li>The impact of intra- and extra-household agency and (power) dynamics and other structural barriers (e.g. socio-cultural norms and geographic location) for children and adults of different ages and with different vulnerabilities (e.g. living with disabilities, from marginalised groups);&nbsp;</li>\\n<li>The existence of positive opportunities and entry points that leverage a situation to maximise positive impacts for children.&nbsp;</li>\\n</ul>\\n<p>Project teams must undertake a variety of economic and livelihood assessments to gain the contextual knowledge they need to determine what types of project modalities will best address the economic constraints that HHs face in a given context. Such economic-specific assessments include:</p>\\n<ul>\\n<li>Household Economy Analysis (HEA)</li>\\n<li>Coping Strategy Index (CSI)</li>\\n<li>Market System Analysis</li>\\n<li>Value Chain Analysis</li>\\n<li>Seasonal calendars</li>\\n<li>Weather forecasts</li>\\n<li>Cost Barrier Analysis</li>\\n</ul>\\n<p>In addition to these typical economic and livelihoods assessments, project teams should also undertake child sensitive analysis to determine the most appropriate child-sensitive PA programme interventions. This Building Block presents two action steps (and corresponding tools) for conducting child-sensitive analysis for PA programmes. These are:&nbsp;</p>\\n<h4>Analysis Action 1: Identify Child Deprivations,  Aspirations, and Context&nbsp;</h4>\\n<ul>\\n<li>Tool 1.1: Child-Sensitive Assessment Matrix and Accompanying Guide</li>\\n</ul>\\n<h4>Analysis Action 2: Identify Root Causes of Child Deprivations&nbsp;</h4>\\n<ul>\\n<li>Tool 2.1: Problem Prioritization&nbsp;</li>\\n<li>Tool 2.2: Problem Tree&nbsp;</li>\\n</ul>\\n<p>Finally, project teams should aim to identify synergies between their economic and child-sensitive analyses. For example, HEA analysis can be used to estimate some of the typical costs HH may incur to meet their childrenâ€™s health and education needs. This is important because when taken together the findings of both types of analysis can help project teams best ascertain if/how these two areas influence each other.&nbsp;&nbsp;</p>\\n","type":"paragraph"}}},"1":{"type":"section","content":{"0":{"type":"image","source":"data:image/jpeg;base64,","caption":"Caption needed"}}},"2":{"type":"section","content":{"0":{"text":"Actions","type":"header"},"1":{"text":"Identify Child Deprivations,  Aspirations, and Context","type":"action"},"2":{"text":"Identify Root Causes of Child Deprivations","type":"action"}}}}'
}}}},pathContext:{slug:"building-blocks/analysis"}}}});
